truncate table util_link_a732_nc2020 ;

with imp_nc4_a732 as (
    select a732, left(nc8, 4) nc4, sum(valeur) as valeur
    from util_import_2019_nc8_a732
    group by a732, left(nc8, 4)
)
   , res as (
    select a732, nc4, round(valeur/sum(valeur) over (partition by a732),5) proximity
    from imp_nc4_a732
)
