select res.a732, nc4, a732.id, lvl1.id, proximity
from res
         left join util_nomenclature_naf_a732 a732 on a732.code = res.a732
         left join util_nomenclature_nc2020_lvl1 lvl1 on lvl1.code = res.nc4
;

DROP PROCEDURE if exists process_product_faker() ;

CREATE PROCEDURE process_product_faker()
AS $$
DECLARE
    _max integer;
    _actu integer;
    _incr integer;
BEGIN
    select max(id) into _max from establishment ;
    _actu = 0;
    _incr = 10000;
    delete from product where fake=true ;
    while (_actu<=_max)
        LOOP
            raise info 'actu: %-% / %', _actu, _actu+_incr-1, _max;
            with product as (
                SELECT proximity.naf_a732 naf,
                       product.id,
                       product.name as name,
                       row_number() over (partition by proximity.naf_a732) rc,
                       count(*) over (partition by proximity.naf_a732) nbr
                FROM nomenclature_product product
                         INNER JOIN util_link_a732_nc2020 proximity ON product.code_hs4 =  proximity.nc2020_lvl1
                WHERE proximity.proximity > 0.4
                  AND length(product.code_nc) = 10
            )
               , by_naf as (
                select distinct naf, nbr
                from product p
            )
               , esta as (
                SELECT establishment.id,
                    activity.code
                     , cast(1+trunc(random() * by_naf.nbr) as int) nb_to_take
                     , by_naf.nbr
                FROM establishment
                         INNER JOIN nomenclature_activity activity ON establishment.main_activity_id = activity.id
                         INNER JOIN by_naf on by_naf.naf = activity.code
                WHERE activity.section_id IN (1, 2, 3, 4, 5)
                  AND coalesce(establishment.workforce_group,'NN') != 'NN'
            )
               , esta_lig as (
                select distinct esta.*, cast(1+trunc(random() * esta.nbr) as int) rc
                from esta
                   , LATERAL generate_series(1, esta.nb_to_take) g
            )
            insert into product (establishment_id, nomenclature_product_id, name, fake, updated_by)
            select el.id, p.id, p.name, true, 0
            from esta_lig el
                     inner join product p on p.naf = el.code and p.rc = el.rc
            where el.id between _actu and _actu + _incr -1	;

            _actu = _actu + _incr;
        END LOOP;
END ;
$$ LANGUAGE plpgsql;

call process_product_faker() ;

DROP PROCEDURE if exists process_product_faker() ;
